import React from "react"

let btnNotClicked = true
const Table = props => {
  // const [bookingList, setBookingList] = useState([])

  // setBookingList(bookingList.concat(props.values))
  let yesBtn = document.querySelector(".yesBtn")

  const clickHandle = () => {
    yesBtn.style.display = "none"
    // alert("kuku")
    btnNotClicked = false
  }

  return (
    <div>
      <h3>Booking List</h3>

      <table>
        <thead>
          <tr>
            <th>FirstName</th>
            <th>LastName</th>
            <th>Email</th>
            <th>Tel Number</th>
            <th>Cover</th>
            <th>Date</th>
            <th>Time</th>
            {/*  */}
            <th>seated</th>
          </tr>
        </thead>

        <tbody>
          {props.bookingList.map(value => {
            return (
              <tr className="rows">
                <td>{value.firstName}</td>
                <td>{value.lastName}</td>
                <td>{value.email}</td>
                <td>{value.telNumber}</td>
                <td>{value.cover}</td>
                <td>{value.date}</td>
                <td>{value.time}</td>
                {/* <input type="checkbox" name="no" defaultChecked={!checked} onChange={() => setChecked(checked)} /> */}

                {/* <label htmlFor="no">not yet</label> */}

                <td>
                  {!btnNotClicked && (
                    <button className="yesBtn" onClick={clickHandle}>
                      {" "}
                      seated
                    </button>
                  )}
                </td>
                <td>{btnNotClicked && <button onClick={clickHandle}> not arrived</button>}</td>
              </tr>
            )
          })}
        </tbody>
      </table>
    </div>
  )
}

export default Table
